import React from "react";

import {
  Dimensions,
  Image,
  SafeAreaView,
  StyleSheet,
  Text,
  View,
} from "react-native";
import { Button, Paragraph } from "react-native-paper";

const { height, width } = Dimensions.get("window");
const imageHeight = Math.round((width * 9) / 16);

export default function Welcome() {
  return (
    <SafeAreaView style={styles.main_container}>
      <View style={styles.welcome_container}>
        <Text>Welcome to React APP</Text>
        <Image style={styles.image} source={require("../assets/logo.png")} />
      </View>
      <View style={styles.buttons_container}>
        <Paragraph>Already have account ?</Paragraph>
        <Button
          style={styles.button}
          mode="contained"
          onPress={() => console.log("Pressed")}
        >
          Sign In
        </Button>
        <Paragraph>OR</Paragraph>
        <Button
          style={styles.button}
          mode="contained"
          onPress={() => console.log("Pressed")}
        >
          Sign Up
        </Button>
      </View>
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  main_container: {
    flex: 1,
  },
  welcome_container: {
    flex: 5,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
    marginTop: 50,
  },
  image: {
    marginTop: 20,
    marginBottom: 40,
    width: width,
    height: imageHeight,
  },
  buttons_container: {
    flex: 5,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
  button: {
    width: width * 0.5,
    margin: 10,
  },
});
